import "./GuessRow.css"
import Letter from "../Letter/Letter"

export default function GuessRow (params) {
    const {
        id, 
        keywordLetters,
        boardLetters,
        boardEvaluated
    } = params
    return (
        <div 
            className ="row"
            id = {id}
        >
            {[...Array(keywordLetters).keys()].map((arg) => {
                return(
                    <>
                    <div
                        key = {arg}
                        id = {arg}
                        className="letter" 
                    >A
                    </div> 
                 </>
                )
            })}
        </div> 
    )
}
